;/*********************************************************************
;/** ASM_AlphaBlt32                                                  **
;/**                                                                 **
;/** void ASM_AlphaBlt32(BLTDATA *data)                              **
;/*********************************************************************
%if arch_elf64=1 || arch_win64=1
	global ASM_AlphaBlt32
	ASM_AlphaBlt32:
	%if arch_elf64=1
									; Pointer auf data ist in rdi
		mov r8,rdi					; Pointer nach r8 schieben
	%elif arch_win64=1
									; Pointer auf data ist zunächst in rcx
		mov r8,rcx					; Pointer nach r8 schieben
		push rdi					; rdi und rsi müssen unter WIN64 gerettet werden
		push rsi
                push r12
	%endif
	push rbx					; rbx retten bx
	mov eax, 0x00ffffff
	pxor mm6,mm6
	movd mm3,eax				;// Fuer Or-Maske, damit Alpha-Channel immer ff ist
	mov eax,0x000000ff
	mov rdi,[r8+tgt]			;// Zieladresse nach r8 => rdi
	movd mm7,eax
	mov rsi,[r8+src]
	mov r10d,[r8+pitchsrc]
	mov r11d,[r8+pitchtgt]

	sub rdi,4					;// Wir gehen von rechts nach links, von Breite bis 1 (nicht 0),
	sub rsi,4					;// daher müssen wir bei der Basisadresse eine Position nach links gehen
	mov edx,[r8+height]
	pshufw mm7,mm7, 0
	mov r9d,[r8+width]			; Breite nach r9
        lea r12, [rel CALCULATEDALPHA@]         ; Pointer to CALCULATEDALPHA Table to r12
	jmp near .aYLoop
	ALIGN 16
	.aYLoop:
		mov ecx,r9d
		jmp near .aXLoop
		ALIGN 16
		.aXLoop:
			mov eax,[rsi+rcx*4]
			test eax,0xff000000
			jz .askip1
				movd mm0,eax				; src-Farbe nach mm0
				shr eax,24					; Alpha-Channel nach al
				cmp al,0xff
				je .noalpha
					movd mm2,[rdi+rcx*4]
					movd mm4,eax			; Alphawert nach mm4
					movd ebx,mm2
					movq mm5,mm7
					shr ebx,16
					punpcklbw mm0,mm6
					mov ah,bh
					pshufw mm4,mm4,0
					punpcklbw mm2,mm6
					mov al, [r12+rax]
					psubusw mm5,mm4
					pmullw mm0,mm4
					pmullw mm2,mm5
					shl eax,24
					psrlq mm0,8			;// Erst shiften und maskieren
					psrlq mm2,8			;// geht schneller als...
					movd mm1,eax
					pand mm0,mm7
					pand mm2,mm7
					paddusw mm0,mm2
					;//psrlq mm0,8		;// ...es nachträglich zu machen
					;//pand mm0,mm7
					packuswb mm0,mm6
					pand mm0, mm3		;// Alpha-Channel erst auf 00
					por mm0,mm1			;// dann den finalen Alpha-Wert hinzufügen
				.noalpha:
					movd [rdi+rcx*4],mm0
			.askip1:
			dec ecx
			jnz .aXLoop
		add rsi,r10
		add rdi,r11
		dec edx
		jnz .aYLoop
	emms
	xor rax,rax
	inc rax					; Returnwert auf 1 setzen
	pop rbx
	%if arch_win64=1
                pop r12
		pop rsi
		pop rdi
	%endif
	ret

%else								; 32-Bit-Version
	global ASM_AlphaBlt32
	global _ASM_AlphaBlt32
	ASM_AlphaBlt32:
	_ASM_AlphaBlt32:
		push ebp
		mov ebp,[esp+8]				; Pointer auf data nach ebp
		pushad
		mov eax, 0xff000000
		pxor mm6,mm6
		movd mm3,eax				;// Fuer Or-Maske, damit Alpha-Channel immer ff ist
		mov eax,0x00ff00ff
		mov edi,[ebp+tgt]
		movd mm7,eax
		mov esi,[ebp+src]

		sub edi,4					;// ?? Wofür soll das gut sein???
		sub esi,4					;// ?? Dito
		mov edx,[ebp+height]
		pshufw mm7,mm7, 0
		jmp near .aYLoop
		ALIGN 16
		.aYLoop:
			mov ecx, [ebp+width]
			jmp near .aXLoop
			ALIGN 16
			.aXLoop:
				mov eax,[esi+ecx*4]
				test eax,0xff000000
				jz .askip1
					movd mm0,eax				; src-Farbe nach mm0
					shr eax,24					; Alpha-Channel nach al
					inc al
					jz .noalpha
						movd mm2,[edi+ecx*4]
						movd mm4,eax			; Um 1 erhöhten Alphawert nach mm4
						movq mm5,mm7
						punpcklbw mm0,mm6
						pshufw mm4,mm4,0
						punpcklbw mm2,mm6
						psubusw mm5,mm4
						pmullw mm0,mm4
						pmullw mm2,mm5
						psrlq mm0,8			;// Erst shiften und maskieren
						psrlq mm2,8			;// geht schneller als...
						pand mm0,mm7
						pand mm2,mm7
						paddusw mm0,mm2
						;//psrlq mm0,8		;// ...es nachträglich zu machen
						;//pand mm0,mm7

						packuswb mm0,mm6
						por mm0, mm3		;// Alpha-Channel auf ff
					.noalpha:
						movd [edi+ecx*4],mm0
				.askip1:
				dec ecx
				jnz .aXLoop
			add esi,[ebp+pitchsrc]
			add edi,[ebp+pitchtgt]
			dec edx
			jnz .aYLoop
		emms
		popad
		xor eax,eax
		pop ebp
		inc eax						; Returnwert auf 1 setzen
		ret
%endif



;/*********************************************************************
;/** ASM_Blt32                                                       **
;/**                                                                 **
;/** void ASM_Blt32(BLTDATA *data)                                   **
;/*********************************************************************
%if arch_elf64=1 || arch_win64=1
	global ASM_Blt32
	ASM_Blt32:
	%if arch_elf64=1
									; Pointer auf data ist in rdi
		mov rcx,rdi					; Pointer nach rcx schieben
	%elif arch_win64=1
									; Pointer auf data ist schon in rcx
		push rdi					; rdi + rsi muessen gerettet werden
		push rsi
	%endif
	push rbx				; rbx wird nicht benutzt
	mov r8d,[rcx+width]		; Breite nach r8d
	mov r10d,[rcx+pitchsrc]	; Pitch der Quelle nach r10
	shl r8,2				; Breite * 4
	mov r11d,[rcx+pitchtgt]	; Pitch des Ziels nach r11
	mov rdi,[rcx+tgt]		; Zieladresse nach rdi
	sub r10,r8				; Breite*4 muss von SourcePitch abgezogen werden
	sub r11,r8				; Breite*4 muss von TargetPitch abgezogen werden
	mov rsi,[rcx+src]		; Quelladresse nach rsi
	mov r8d,[rcx+width]		; Breite nach r8d
	mov r9d,[rcx+height]	; Höhe nach r9d

	.loopLine:
		mov rcx,r8				; Breite nach rcx
		rep movsd
		add rsi,r10				; Nächste Zeile
		add rdi,r11
		dec r9d
	jnz .loopLine

	.end:
	emms					; Wir haben keine MMX-Register verwendet
	pop rbx
	xor rax,rax
	xor rdx,rdx
	%if arch_win64=1
		pop rsi
		pop rdi
	%endif
	inc rax					; Returnwert auf 1 setzen
	ret

%else			; Die 32-Bit Variante
	global ASM_Blt32
	global _ASM_Blt32

	ASM_Blt32:
	_ASM_Blt32:
		push ebp
		mov ebp,[esp+8]			; Pointer auf data nach ebp
		pushad
		movd mm1,[ebp+width]	; Breite nach mm1
		mov eax,[ebp+pitchsrc]	; Pitch der Quelle nach eax
		movd ecx,mm1			; Breite nach ecx kopieren
		mov edx,[ebp+pitchtgt]	; Pitch des Ziels nach edx
		shl ecx,2
		mov edi,[ebp+tgt]		; Zieladresse nach edi
		sub eax,ecx				; Breite*4 muss von SourcePitch abgezogen werden
		sub edx,ecx				; Breite*4 muss von TargetPitch abgezogen werden
		mov esi,[ebp+src]		; Quelladresse nach esi
		mov ebx,[ebp+height]	; Höhe nach ebx
		.loop:
			movd ecx,mm1		; width
			rep movsd
			add edi,edx
			add esi,eax
			dec ebx
			jnz .loop
		emms
		popad
		xor eax,eax
		pop ebp
		inc eax					; Returnwert auf 1 setzen
		ret
%endif


;/*********************************************************************
;/** ASM_BltColorKey32                                               **
;/**                                                                 **
;/** void ASM_BltColorKey32(BLTDATA *data)                           **
;/*********************************************************************
%if arch_elf64=1 || arch_win64=1
	%if arch_elf64=1
		global ASM_BltColorKey32
		ASM_BltColorKey32:			; Pointer auf data ist in rdi
		mov rcx,rdi					; Pointer nach rcx schieben
	%elif arch_win64=1
		global ASM_BltColorKey32
		ASM_BltColorKey32:			; Pointer auf data ist in ecx
		push rdi
		push rsi
	%endif
		push rbx
		push r10
		push r11
		mov r8d,[rcx+width]		; Breite nach r8d
		mov eax,4
		mov r10d,[rcx+pitchsrc]	; Pitch der Quelle nach r10d
		mov r11d,[rcx+pitchtgt]	; Pitch des Ziels nach r11d
		mov rdi,[rcx+tgt]		; Zieladresse nach rdi
		mov rsi,[rcx+src]		; Quelladresse nach rsi
		sub rdi,rax
		mov ebx,[rcx+color]		; Colorkey nach ebx
		sub rsi,rax
		mov r9d,[rcx+height]	; Höhe nach r9d
		.loop:
			mov ecx,r8d			; Breite aus r8d holen
			.loopx:
				mov eax,[rsi+rcx*4]
				cmp eax,ebx		; Colorkey?
				je .skip1
					mov[rdi+rcx*4],eax
				.skip1:
				dec ecx
				jnz .loopx

			add rdi,r11
			add rsi,r10
			dec r9d
		jnz .loop
		;emms
		xor rax,rax
		pop r11
		pop r10
		pop rbx
		inc rax			; Returnwert auf 1 setzen
	%if arch_win64=1
		pop rsi
		pop rdi
	%endif
		ret

%else			; Die 32-Bit Variante

	global ASM_BltColorKey32
	global _ASM_BltColorKey32

	ASM_BltColorKey32:
	_ASM_BltColorKey32:
		push ebp
		mov ebp,[esp+8]			; Pointer auf data nach ebp
		pushad
		movd mm1,[ebp+width]	; Breite nach mm1
		mov eax,4
		movd mm3,[ebp+pitchsrc]	; Pitch der Quelle nach mm3
		movd mm4,[ebp+pitchtgt]	; Pitch des Ziels nach mm4
		mov edi,[ebp+tgt]		; Zieladresse nach rdi
		mov esi,[ebp+src]		; Quelladresse nach rsi
		sub edi,eax
		mov ebx,[ebp+color]		; Colorkey nach ebx
		sub esi,eax
		mov edx,[ebp+height]	; Höhe nach edx
		.loop:
			movd ecx,mm1		; Breite aus mm1 holen
			.loopx:
				mov eax,[esi+ecx*4]
				cmp eax,ebx		; Colorkey?
				je .skip1
					mov[edi+ecx*4],eax
				.skip1:
				dec ecx
				jnz .loopx
			movd eax,mm4
			movd ecx,mm3
			add edi,eax
			add esi,ecx
			dec edx
		jnz .loop
		emms
		popad
		xor eax,eax
		pop ebp
		inc eax
		ret
%endif


